import React, { useState, useEffect } from 'react';
import { Form, Input, Button, Select, Upload, message } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import axios from 'axios';

const { Option } = Select;

const PropertyInputPage = ({ addProperty, currentProperty, cities, districts, setSelectedCity }) => {
  const [form] = Form.useForm();
  const [fileList, setFileList] = useState([]);
  const [loadingDistricts, setLoadingDistricts] = useState(false);
  const [selectedCityId, setSelectedCityId] = useState(null);
  const [category, setCategory] = useState(null);
  const [type, setType] = useState(null);

  useEffect(() => {
    if (currentProperty) {
      form.setFieldsValue({
        name: currentProperty.ilanbaslik,
        description: currentProperty.ilanaciklama,
        price: currentProperty.fiyat,
        city: currentProperty.il,
        district: currentProperty.ilce,
        category: currentProperty.kategori,
        type: currentProperty.tur,
      });
      setFileList(currentProperty.photos || []);
    }
  }, [currentProperty, form]);

  const handleCityChange = (value) => {
    setSelectedCityId(value);
    setSelectedCity(value);
    setLoadingDistricts(true);
    // İlçeleri API'den getirme işlemi
    axios.get(`https://turkiyeapi.dev/api/v1/provinces/${value}/districts`)
      .then(response => {
        setLoadingDistricts(false);
        setDistricts(response.data.data);
      })
      .catch(error => {
        setLoadingDistricts(false);
        console.error('İlçeler alınırken hata oluştu:', error);
      });
  };

  const handleSubmit = (values) => {
    const propertyData = {
      id: currentProperty ? currentProperty.id : new Date().getTime(),
      ilanbaslik: values.name,
      ilanaciklama: values.description,
      fiyat: values.price,
      il: selectedCityId,
      ilce: values.district,
      kategori: category,
      tur: type,
      photos: fileList.map(file => ({
        uid: file.uid,
        name: file.name,
        status: file.status,
        url: file.url || URL.createObjectURL(file.originFileObj),
      })),
    };

    if (currentProperty) {
      // Güncelleme işlemi
      addProperty(propertyData);
    } else {
      // Yeni ekleme işlemi
      addProperty(propertyData);
    }
    message.success('Emlak bilgileri başarıyla kaydedildi.');
    form.resetFields();
    setFileList([]);
  };

  return (
    <div style={{ padding: '50px', background: '#f9f9f9' }}>
      <h2>Emlak Bilgilerini Girin</h2>
      <Form layout="vertical" onFinish={handleSubmit} form={form}>
        <Form.Item label="İlan Başlığı" name="name" rules={[{ required: true, message: 'Lütfen ilan başlığını girin.' }]}>
          <Input />
        </Form.Item>
        <Form.Item label="İlan Açıklaması" name="description">
          <Input.TextArea />
        </Form.Item>
        <Form.Item label="Fiyat" name="price" rules={[{ required: true, message: 'Lütfen fiyatı girin.' }]}>
          <Input />
        </Form.Item>
        <Form.Item label="İl" name="city" rules={[{ required: true, message: 'Lütfen ili seçin.' }]}>
          <Select onChange={handleCityChange}>
            {cities.map(city => (
              <Option key={city.id} value={city.id}>
                {city.name}
              </Option>
            ))}
          </Select>
        </Form.Item>
        <Form.Item label="İlçe" name="district" rules={[{ required: true, message: 'Lütfen ilçeyi seçin.' }]}>
          <Select loading={loadingDistricts}>
            {districts.map(district => (
              <Option key={district.id} value={district.name}>
                {district.name}
              </Option>
            ))}
          </Select>
        </Form.Item>
        <Form.Item label="Kategori" name="category" rules={[{ required: true, message: 'Lütfen kategoriyi seçin.' }]}>
          <Select onChange={setCategory}>
            <Option value="daire">Daire</Option>
            <Option value="villa">Villa</Option>
            <Option value="yazlık">Yazlık</Option>
            <Option value="müstakil ev">Müstakil Ev</Option>
            <Option value="residence">Residence</Option>
          </Select>
        </Form.Item>
        <Form.Item label="Tür" name="type" rules={[{ required: true, message: 'Lütfen türü seçin.' }]}>
          <Select onChange={setType}>
            <Option value="kiralik">Kiralık</Option>
            <Option value="satilik">Satılık</Option>
          </Select>
        </Form.Item>
        <Form.Item label="Fotoğraflar">
          <Upload
            fileList={fileList}
            onChange={({ fileList }) => setFileList(fileList)}
            listType="picture"
            multiple
            beforeUpload={() => false}
          >
            <Button icon={<UploadOutlined />}>Fotoğraf Yükle</Button>
          </Upload>
        </Form.Item>
        <Form.Item>
          <Button type="primary" htmlType="submit">
            {currentProperty ? 'Güncelle' : 'Kaydet'}
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
};

export default PropertyInputPage;
